import React from 'react';
import "./home.css";
import $ from "jquery";


function Preloader() {

  $(window).on('load', function () {
    setTimeout(() => {

      $(".Preloader-container").css("opacity", "0");
    }, 2000);

  });

  return (
        <div className="Preloader-container">
    <div className="preloader"><div className="preloader-circle"></div><div className="preloader-circle"></div><div className="preloader-circle"></div><div className="preloader-circle"></div><div className="preloader-circle"></div><div className="preloader-circle"></div><div className="preloader-circle"></div><div className="preloader-circle"></div><div className="preloader-circle"></div><div className="preloader-circle"></div></div>
  </div>
  );
}

export default Preloader;
